import React from "react";
import { NavLink } from "react-router-dom";
import Navbar from "../Navbar";

function Account({ filterChecklistTypes }) {
  const name = "Marcus";
  const id = "10001"
  const user_type = "Auditor"
  return (
    <div>
      <Navbar />
      <h2>Account</h2>
      <div>Name: {name}</div>
      <div>User ID: {id}</div>
      <div>User Type: {user_type}</div>
    </div>
  );
}

export default Account;
